import React from 'react';
import { FaHeart, FaEye } from "react-icons/fa";

const VideoBar = () => {
  let heartStyle = { color: "red", fontSize: "1.5em" };
  let eyeStyle = { color: "blue", fontSize: "1.5em" };
  return (

  <div id="videoBar">
      <button className="btn btn-danger"
        data-toggle="tooltip"
        data-placement="bottom"
        title="Add to favoutites!"> Add to favourites <span className="loveheart">
          <FaHeart style={ heartStyle }/></span></button>

      <button className="btn btn-success"
        data-toggle="tooltip"
        data-placement="bottom"
        title="Add to Watchlist!"> Add to Watchlist <span className="loveheart">
          <FaEye style={ eyeStyle }/></span></button>

  </div>
)

}

export default VideoBar;
